(function() {
	'use strict';
	ObjC.import('AppKit');

	var KMEngine = (function() {
		var _engineApp;

		return {
			convertStringToPlist: function(str) {
				return ObjC.deepUnwrap(
					$.NSPropertyListSerialization.propertyListWithDataOptionsFormatError(
						$(str).dataUsingEncoding($.NSUTF8StringEncoding), 0, 0, null));
			},

			getEngineAppName: function() {
				return "Keyboard Maestro Engine";
			},

			getEngineApp: function() {
				if (!_engineApp)
					_engineApp = Application(this.getEngineAppName());
				return _engineApp;
			},

			getHotKeys: function(asString, getAll) {
				return this.getEngineApp().gethotkeys({ asstring: asString === true, getall: getAll === true });
			},

			getHotKeysAsPlist: function(getAll) {
				return this.convertStringToPlist(this.getHotKeys(true, getAll));
			},

			getMacros: function(binary) {
				return this.getEngineApp().getmacros({
					asstring: !binary
				});
			},

			getMacrosAsPlist: function() {
				return this.convertStringToPlist(this.getMacros(false));
			},

			setVariable: function(name, value) {
				this.getEngineApp().setvariable(name, {
					to: value
				});
			},
		};
	})();

	function compare(a, b) {
		return a < b ? -1 : a > b ? 1 : 0;
	}

	function alphanumCase(a, b) {
		function chunkify(t) {
			var tz = new Array();
			var x = 0,
				y = -1,
				n = 0,
				i, j;

			while (i = (j = t.charAt(x++)).charCodeAt(0)) {
				var m = (i == 46 || (i >= 48 && i <= 57));
				if (m !== n) {
					tz[++y] = "";
					n = m;
				}
				tz[y] += j;
			}
			return tz;
		}

		var aa = chunkify(a.toLowerCase());
		var bb = chunkify(b.toLowerCase());

		for (var x = 0; aa[x] && bb[x]; x++) {
			if (aa[x] !== bb[x]) {
				var c = Number(aa[x]),
					d = Number(bb[x]);
				if (c == aa[x] && d == bb[x]) {
					return c - d;
				} else return (aa[x] > bb[x]) ? 1 : -1;
			}
		}
		return aa.length - bb.length;
	}

	function run() {
		var plist = KMEngine.getMacrosAsPlist();
		var items = [];
		plist.forEach(function(group) {
			if (group.macros) {
				group.macros.forEach(function(macro) {
					items.push({
						macroUUID: macro.uid,
						macroName: macro.name,
						groupName: group.name
					});
				});
			}
		});

		items = items.filter(function(item) {
			return item.macroName.indexOf("---") < 0 &&
				!item.macroName.endsWith("[Quick Macro]");
		}).sort(function(a, b) {
			var result = alphanumCase(a.macroName, b.macroName);
			if (result === 0)
				result = alphanumCase(a.groupName, b.groupName);
			return result;
		});

		KMEngine.setVariable("sspData", JSON.stringify(items));
		return "OK";
	}

	try {
		return run();
	} catch (e) {
		return "Error: " + e.message;
	}
})();

(function() {
	'use strict';

	var KMEngine = (function() {
		var _engineApp;

		return {
			getEngineAppName: function() {
				return "Keyboard Maestro Engine";
			},

			getEngineApp: function() {
				if (!_engineApp)
					_engineApp = Application(this.getEngineAppName());
				return _engineApp;
			},

			getVariable: function(name, required) {
				var result = this.getEngineApp().getvariable(name);
				if (!result && required)
					throw Error("Variable '" + name + "' is empty");
				return result;
			},
		};
	})();

	var KMEditor = (function() {
		var _editorAppName = "Keyboard Maestro";
		var _editorApp;

		return {
			editMacro: function(uuidOrUniqueName) {
				this.getEditorApp().editmacro(uuidOrUniqueName);
			},

			getEditorApp: function() {
				return _editorApp ? _editorApp : _editorApp = Application(_editorAppName);
			},

			getEditorAppName: function() {return _editorAppName;},
		};
	})();

	function run() {
		var macroUUID = KMEngine.getVariable("sspResult", true);
		KMEditor.editMacro(macroUUID);
		return "OK";
	}

	try {
		return run();
	} catch (e) {
		return "Error: " + e.message;
	}
})();
